    false,nt"url": null,nt"notes": "This coverage contains estimates of land
    in agricultural production in counties in the conterminous United States as reported
    in the 1987 Census of Agriculture (U.S. Department of Commerce, 1989a). Land in
    agriculture data are reported as either a number (for example, number of Farms),
    acres, or as a percentage of county area. Land in agriculture estimates were generated
    from surveys of all farms where $1,000 or more of agricultural products were sold,
    or normally would have been sold, during the census year. Most of the attributes
    summarized represent 1987 data, but some information for the 1982 Census of Agriculture
    also was included. The polygons representing county boundaries in the conterminous
    United States, as well as lakes, estuaries, and other nonland-area features were
    derived from the Digital Line Graph (DLG) files representing the 1:2,000,000-scale
    map in the National Atlas of the United States (1970). Agricultural land Census
    of Agriculture Counties United States",nt"license_title": null,nt"extras":
